//get dossiers from JLogiciels HTML's response
var refs = []
await fetch("https://jaime.jlogiciels.fr/main_tableur.php?table=UP_Dossiers&ajax=oui", {
  "headers": {
    "accept": "*/*",
    "accept-language": "fr-FR,fr;q=0.9,en-US;q=0.8,en;q=0.7",
    "content-type": "text/html; charset=UTF-8",
    "sec-ch-ua": "\"Google Chrome\";v=\"95\", \"Chromium\";v=\"95\", \";Not A Brand\";v=\"99\"",
    "sec-ch-ua-mobile": "?0",
    "sec-ch-ua-platform": "\"Windows\"",
    "sec-fetch-dest": "empty",
    "sec-fetch-mode": "cors",
    "sec-fetch-site": "same-origin"
  },
  "referrer": "https://jaime.jlogiciels.fr/index.php",
  "referrerPolicy": "strict-origin-when-cross-origin",
  "body": null,
  "method": "GET",
  "mode": "cors",
  "credentials": "include"
})
.then(prm=>prm.text())
.then(htm=>{
    var dossiers = document.createElement('div');
    dossiers.innerHTML = htm
    dossiers.querySelectorAll(".tableauCel input").forEach(r=>{
        let id = r.id.split('_').length === 2 ? r.id.split('_')[1] : false
        if(id){
            fetch("https://jaime.jlogiciels.fr/fenetre_element.php?modeIHM=FENETRE&id="+id+"&hauteur=625&largeur=853&modeIHM=FENETRE", {
            "headers": {
                "accept": "*/*",
                "accept-language": "fr-FR,fr;q=0.9,en-US;q=0.8,en;q=0.7",
                "content-type": "text/html; charset=UTF-8",
                "sec-ch-ua": "\"Google Chrome\";v=\"95\", \"Chromium\";v=\"95\", \";Not A Brand\";v=\"99\"",
                "sec-ch-ua-mobile": "?0",
                "sec-ch-ua-platform": "\"Windows\"",
                "sec-fetch-dest": "empty",
                "sec-fetch-mode": "cors",
                "sec-fetch-site": "same-origin"
            },
            "referrer": "https://jaime.jlogiciels.fr/index.php",
            "referrerPolicy": "strict-origin-when-cross-origin",
            "body": null,
            "method": "GET",
            "mode": "cors",
            "credentials": "include"
            }).then(prm=>prm.text())
            .then(form=>{
                let details = document.createElement('div')
                details.innerHTML = form
                refs.push(details.querySelector("#ChampsOnglet_RefCommandeClient").value)
            }).catch(err=>console.log("Erreur détails dossier ",err))
        }
    })
})

